ith both traditional and computer significance, such as writing tools and hands, reading glasses, clipping scissors, bell, bomb, check boxes, as well as more traditional images such as weather signs, religious symbols, astrological signs, encircled numerals, a selection of ampersands and interrobangs, plus elegant flowers and flourishes. \r\n\r\nPointing and indicating are frequent functions in graphical interfaces, so in addition to a wide selection of pointing hands, the Wingdings fonts also offer arrows in careful gradations of weight and different directions and styles. For variety and impact as bullets, asterisks, and ornaments, Windings also offers a varied set of geometric circles, squares, polygons, targets, and stars.Wingdings Regular: MS: 2006Version 5.00Wingdings-RegularWingdings is either a registered trademark or a trademark of Microsoft Corporation in the United States and/or other countries. Microsoft Typographyhttp://www.microsoft.com/truetype/fonts/wingdings/You may use this font as permitted by the EULA for the product in which this font is included to display and print content.  You may only (i) embed this font in content as permitted by the embedding restrictions included in this font; and (ii) temporarily download this font to a printer or other output device to help print content.\0n\0o\0r\0m\0a\0l\0S\0t\0a\0n\0d\0a\0r\0d\0\0 \02\00\00\06\0 \0M\0i\0c\0r\0o\0s\0o\0f\0t\0 \0C\0o\0r\0p\0o\0r\0a\0t\0i\0o\0n\0.\0 \0A\0l\0l\0 \0R\0i\0g\0h\0t\0s\0 \0R\0e\0s\0e\0r\0v\0e\0d\0.\0T\0h\0e\0 \0W\0i\0n\0g\0d\0i\0n\0g\0s\0 \0f\0o\0n\0t\0s\0 \0w\0e\0r\0e\0 \0d\0e\0s\0i\0g\0n\0e\0d\0 \0b\0y\0 \0K\0r\0i\0s\0 \0H\0o\0l\0m\0e\0s\0 \0a\0n\0d\0 \0C\0h\0a\0r\0l\0e\0s\0 \0B\0i\0g\0e\0l\0o\0w\0 \0i\0n\0 \01\09\09\00\0 \0a\0n\0d\0 \01\09\09\01\0.\0 \0\r\0\n\0\r\0\n\0T\0h\0e\0 \0f\0o\0n\0t\0s\0 \0w\0e\0r\0e\0 \0o\0r\0i\0g\0i\0n\0a\0l\0l\0y\0 \0n\0a\0m\0e\0d\0 \0L\0u\0c\0i\0d\0a\0 \0I\0c\0o\0n\0s\0,\0 \0A\0r\0r\0o\0w\0s\0,\0 \0a\0n\0d\0 \0S\0t\0a\0r\0s\0 \0t\0o\0 \0c\0o\0